        body::before {
            content: "";
            position: fixed;
            inset: 0;
            background: rgba(8, 18, 43, 0.38);
            backdrop-filter: blur(6px);
            z-index: 0;
        }
        .page-shell {
            position: relative;
            width: min(1160px, 94vw);
            margin: 64px auto 80px;
            z-index: 1;
        }
        .header {
            background: rgba(10, 26, 55, 0.7);
            border: 1px solid rgba(255, 255, 255, 0.2);
            border-radius: 26px;
            padding: 44px 32px;
            text-align: center;
            box-shadow: var(--shadow-strong);
            backdrop-filter: blur(22px);
        }
        .header .eyebrow {
            display: inline-block;
            text-transform: uppercase;
            letter-spacing: 0.22em;
            font-size: 12px;
            color: var(--ink-300);
            margin-bottom: 14px;
        }
        .header h1 {
            margin: 0;
            font-size: 38px;
            font-weight: 600;
            letter-spacing: 0.02em;
            color: #ffffff;
        }
        .header p {
            max-width: 660px;
            margin: 16px auto 0;
            line-height: 1.6;
            color: var(--ink-100);
            font-size: 18px;
        }
        .panel {
            margin-top: 26px;
            padding: 32px 30px 40px;
            background: var(--frost-surface);
            border: 1px solid rgba(255, 255, 255, 0.16);
            border-radius: 22px;
            backdrop-filter: blur(22px);
            box-shadow: var(--shadow-soft);
        }
        .icon-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
            gap: 20px 24px;
            margin-top: 8px;
            justify-items: center;
        }
        .icon-grid.is-hidden {
            display: none;
        }
        .icon-card {
            width: 100%;
            max-width: 240px;
            padding: 20px 18px;
            border-radius: 18px;
            background: var(--frost-card);
            color: var(--ink-900);
            box-shadow: 0 16px 32px rgba(12, 30, 63, 0.18);
            border: 1px solid rgba(28, 70, 130, 0.16);
            cursor: pointer;
            transition: transform 0.18s ease, box-shadow 0.18s ease, background 0.18s ease;
        }
        .icon-card:focus-visible {
            outline: 3px solid rgba(46, 197, 255, 0.65);
            outline-offset: 4px;
        }
        .icon-card:hover {
            transform: translateY(-4px);
            background: var(--frost-card-hover);
            box-shadow: 0 22px 38px rgba(12, 30, 63, 0.24);
        }
        .icon-card .icon {
            font-size: 38px;
            margin-bottom: 10px;
            color: var(--accent-secondary);
        }
        .icon-card .title {
            font-weight: 600;
            font-size: 17px;
            letter-spacing: 0.01em;
        }
        .icon-card .record-count {
            margin-top: 4px;
            font-size: 13px;
            color: rgba(15, 40, 82, 0.65);
        }
        .data-view {
            display: none;
            margin-top: 26px;
        }
        .data-view.active {
            display: block;
        }
        #data-title {
            margin: 0 0 18px;
            font-size: 26px;
            font-weight: 600;
            letter-spacing: 0.01em;
            color: #ffffff;
        }
        .controls {
            display: flex;
            flex-wrap: wrap;
            gap: 12px;
            align-items: center;
            margin-bottom: 20px;
        }
        .controls input {
            flex: 1 1 240px;
            padding: 11px 18px;
            border-radius: 999px;
            border: 1px solid rgba(35, 92, 170, 0.3);
            background: rgba(255, 255, 255, 0.85);
            color: var(--ink-900);
            font-size: 15px;
            transition: border-color 0.18s ease, box-shadow 0.18s ease;
        }
        .controls input::placeholder {
            color: rgba(28, 70, 130, 0.6);
        }
        .controls input:focus {
            outline: none;
            border-color: var(--accent-primary);
            box-shadow: 0 0 0 3px rgba(44, 109, 223, 0.22);
            background: rgba(255, 255, 255, 0.95);
        }
        .controls button {
            border: none;
            border-radius: 999px;
            padding: 11px 22px;
            font-size: 15px;
            font-weight: 600;
            letter-spacing: 0.02em;
            background: linear-gradient(135deg, var(--accent-primary), var(--accent-secondary));
            color: #ffffff;
            cursor: pointer;
            transition: box-shadow 0.18s ease, transform 0.18s ease;
        }
        .controls button:hover {
            transform: translateY(-1px);
            box-shadow: 0 14px 26px rgba(12, 30, 63, 0.28);
        }
        table {
            width: 100%;
            border-collapse: collapse;
            border-radius: 18px;
            overflow: hidden;
            background: rgba(255, 255, 255, 0.92);
            color: var(--ink-900);
            box-shadow: 0 20px 36px rgba(12, 30, 63, 0.18);
        }
        thead tr {
            background: var(--table-header);
            color: var(--ink-900);
        }
        th, td {
            padding: 13px 16px;
            text-align: left;
            border-bottom: 1px solid var(--table-divider);
            font-size: 14px;
        }
        th {
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.04em;
            cursor: pointer;
            position: relative;
        }
        tbody tr:hover {
            background: var(--table-hover);
        }
        .empty-cell {
            padding: 26px 18px;
            text-align: center;
            font-style: italic;
            color: rgba(15, 40, 82, 0.7);
        }
        .error-message {
            text-align: center;
            margin: 36px auto;
            color: #ffb4b4;
            font-weight: 500;
        }
        @media (max-width: 768px) {
            .page-shell {
                margin: 36px auto 48px;
            }
            .header {
                padding: 32px 24px;
            }
            .header h1 {
                font-size: 32px;
            }
            .panel {
                padding: 26px 20px 34px;
            }
            .icon-card {
                max-width: none;
            }
            .controls {
                flex-direction: column;
                align-items: stretch;
            }
            .controls button {
                width: 100%;
            }
            table {
                font-size: 13px;
            }
        }
    </style>
</head>
<body>
    <div class="page-shell">
        <header class="header">
            <span class="eyebrow">Passive Reconnaissance - TAQA</span>
            <h1>Interactive Findings Appendix</h1>
            <p>Explore the full dataset that underpins the Trustwave threat intelligence assessment. Choose a category to open the raw evidence table, then search or sort to spotlight the entries that matter most.</p>
        </header>
        <main class="panel">
            <div id="app">
                <div class="icon-grid" id="icon-grid" aria-live="polite"></div>
                <div class="data-view" id="data-view" aria-hidden="true">
                    <div class="controls">
                        <input type="text" id="search-box" placeholder="Search within this table...">
                        <button type="button" id="back-button">Back to Categories</button>
                    </div>
                    <h2 id="data-title"></h2>
                    <table id="data-table">
                        <thead id="table-head"></thead>
                        <tbody id="table-body"></tbody>
                    </table>
                </div>
            </div>
        </main>
    </div>
    <!-- SCRIPT_PLACEHOLDER -->
</body>
</html>
